def postfix_to_prefix(post_exp: str) -> str:
    """"""
    stack = []
    operators = {'^', '*', '/', '+', '-'}
    for char in post_exp:
        if char not in operators:
            stack.append(char)
        elif len(stack) >= 2:
            operand1 = stack.pop()
            operand2 = stack.pop()
            stack.append(char + operand2 + operand1)
    return stack[0]
